  \"2015-08-21T22:54:46.997512\",\n\t\"name\": \"voluntary-service-system-vss\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Voluntary Service System (VSS) is a national-level
  application which replaced the site-based Voluntary Timekeeping System (VTK). VTK
  was used for many years at the Veterans Affairs Medical Centers to track and manage
  the hours of service contributed by volunteers and volunteer organizations. Consistency
  of data between sites was a problem and the process of compiling national VTK reports
  was slow and costly. Many steps were involved because national data was only consolidated
  once a month and it was usually out of sync. Improved data collection and reporting
  is now available since users interact directly with a centralized national database.
  Rehosted VSS uses .NET technology that replaced data transmissions between sites
  and the Austin Information Technology Center to produce the consolidated national
  reports. Direct access to data provides instantaneous updates and up-to-the-minute
  reporting for all users. Central Office administrators and Voluntary staff now have
  broader more reliable data for managing Volunteer Services.\",\n\t\"license_title\":
